import React, { useEffect, useState } from 'react';
import Image from 'next/image';


type IProps = { data: [] }

const SlideShow: React.FC<IProps> = (props: IProps) => {

    const testImage = "data:image/png;base64,";

    const CARDS = [
        {
            title: "somthing 1 ",
            background:testImage,
        },
        {
            title: "somthing 2 ",
            background:testImage,
        },
        {
            title: "somthing 3",
            background: testImage,
        },
        {
            title: "somthing 4 ",
            background: "data:image/webp;base64,",
        },
        {
            title: "somthing 5 ",
            background: "data:image/webp;base64,",
        },
        {
            title: "somthing 6 ",
            background: "data:image/webp;base64,",
        },
        {
            title: "somthing 7 ",
            background: testImage,
        },
        {
            title: "somthing 8 ",
            background: testImage,
        },
        {
            title: "somthing 9 ",
            background: testImage,
        },
        {
            title: "somthing 10",
            background: testImage,
        },
    ];

    const MAX_VISIBILITY = 3;

    const Card = ({ title, background }: any) => {
        return (
            <div className="card w-full h-full md:w-10/12 md:h-[80%] md:mx-auto flex flex-col relative">
                <div className='flex mx-auto justify-center mt-5 h-[75%] w-9/12'>
                    {background && <Image width={500} height={700} alt={'Neon'} src={background} />}
                </div>

            </div>
        );
    };

    const Carousel = ({ children }: any) => {

        let [active, setActive] = useState<number>(2);
        const [animate, setAnimate] = useState<string>("increament");

        useEffect(() => {
            const interval = setInterval(() => {
                if (active === 9) {
                    setAnimate("decreament");
                } else if (active === 0) {
                    setAnimate("increament");
                }
                if (animate === "increament") {
                    setActive(active++);
                } else if (animate === "decreament") {
                    setActive(active--);
                }
            }, 4000);
            return () => {
                clearInterval(interval);
            };
        }, [animate]);

        return React.createElement(
            "div",
            { className: "carousel" },
            React.Children.map(children, (child, i) =>
                React.createElement(
                    "div",
                    {
                        className: "card-container",
                        style: {
                            "--active": i === active ? 1 : 0,
                            "--offset": (active - i) / 3,
                            "--direction": Math.sign(active - i),
                            "--abs-offset": Math.abs(active - i) / 3,
                            // "pointer-events": active === i ? "auto" : "none",
                            opacity: Math.abs(active - i) >= MAX_VISIBILITY ? "0" : "1",
                            display: Math.abs(active - i) > MAX_VISIBILITY ? "none" : "block",
                        },
                    },
                    child
                )
            )
        );
    };

    const SlideShow = () =>
        React.createElement(
            "div",
            { className: "app" },
            React.createElement(
                Carousel,
                null,
                CARDS.map((item, i) =>
                    React.createElement(Card, {
                        title: "Card " + (i + 1),
                        background: item.background,
                    })
                )
            )
        );



    return (
        <React.Fragment>
            <SlideShow />
        </React.Fragment>
    )
}
export default SlideShow;